import React from "react";
import { Row, Col, Card } from "antd";

/* custom component */
import Header from "../../component/Header/Header";
import { PageContainer } from "../../component/Xcomponent";

const Home = (props) => {
  return (
    <React.Fragment>
      <Header />
      <PageContainer>
        <div
          className="site-card-wrapper"
          style={{
            marginTop: "10px",
            border: "3px solid #5B0C1C",
            padding: "0 1em",
            borderRadius: "10px",
            paddingBottom: "20px",
          }}
        >
          <h3
            style={{
              width: "fit-content",
              marginTop: "-14px",
              marginLeft: "-10px",
              background: "#f3f3f3",
            }}
          >
            <b>Dashboard</b>
          </h3>
          <Row gutter={16}>
            <Col span={8}>
              <Card title="Card title" bordered={false}>
                Card content
              </Card>
            </Col>
            <Col span={8}>
              <Card title="Card title" bordered={false}>
                Card content
              </Card>
            </Col>
            <Col span={8}>
              <Card title="Card title" bordered={false}>
                Card content
              </Card>
            </Col>
          </Row>
        </div>
      </PageContainer>
    </React.Fragment>
  );
};

export default Home;
